import { reactive } from 'vue';
import { ref } from "vue";
import axios from "axios";
export default {
  name: "UploadForm",
  setup() {
    const dialogVisible = ref(false);
    const openFormDialog = () => {
      dialogVisible.value = true;
    };
    const closeFormDialog = () => {
      dialogVisible.value = false;
    };
    const form = reactive({
      name: '',
      description: '',
      quantity: 1,
      imageUrl: '',
      price: 0
    });
    const onSubmit = () => {
      console.log(form);
      axios.post('/products', form).then(response => {
        // 处理成功响应
        console.log('Data added successfully:', response.data);
      }).catch(error => {
        // 处理错误
        console.error('Error adding data:', error);
      });
      dialogVisible.value = false;
    };
    return {
      dialogVisible,
      form,
      onSubmit,
      openFormDialog,
      closeFormDialog
    };
  }
};
